package com.webweeb.backend.entity;import jakarta.persistence.*;import lombok.*;@EqualsAndHashCode(callSuper = true)@Entity@Data@AllArgsConstructor@NoArgsConstructor@Builder@Table(name = "\"login_history\"")public class LoginHistory extends BaseEntity {    @ManyToOne(fetch = FetchType.LAZY)    @JoinColumn(name = "user_id", referencedColumnName = "id")    private User user;    @Column(nullable = false)    private String ipAddress;    @Column(nullable = false)    private String userAgent;    @Column(nullable = false)    private String deviceType;    @Column(nullable = false)    private String deviceName;    @Column(nullable = false)    private String osName;    @Column(nullable = false)    private String osVersion;    @Column(nullable = false)    private String browserName;    @Column(nullable = false)    private String browserVersion;    @Column(nullable = false)    private String location;}